'use strict';

var _modules = require('ui/modules');

_modules.uiModules.get('kibana').directive('draggableHandle', function () {
  return {
    restrict: 'A',
    require: '^draggableItem',
    link: function link($scope, $el, attr, ctrl) {
      ctrl.registerHandle($el);
      $el.addClass('gu-handle');
    }
  };
});
